import { GithubIcon } from '../../icons/Github';

const About = () => {
    return (
        <div>
            <h1>Hi, I'm Steven</h1>
            <h5>I've always loved solving problems and being a technophile who was obsessed with the latest tech.</h5>
            <GithubIcon />
        </div>

    )
}

export default About;
